import React from "react";

function NewSale() {
    return (
        <div className="text-white">
            <div class="mb-6">
                <label for="default-input" className="block mb-2 text-sm font-medium text-white">Default input</label>
                <input type="text" id="default-input" className="bg-gray-50 border border-gray-300 text-white text-sm rounded-lg p-2.5 bg-white-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" />
            </div>
        </div>
    )
}

export default NewSale;
